//Functions
//<<<Loading
function Loading(showORhide, resize, el_wrapper, el_tohide) {
	if (showORhide === 'show') {
		el_tohide.css("visibility", "hidden");
		if (resize === true) {
			el_wrapper.css("background-image", loading_gif_1).css("background-position", "center").css("background-repeat", "no-repeat").css("background-size", "contain");
		} else {
			el_wrapper.css("background-image", loading_gif_1).css("background-position", "center").css("background-repeat", "no-repeat");
		};		
	} else {
		el_tohide.css("visibility", "");
		el_wrapper.css("background-image", "").css("background-position", "").css("background-repeat", "");
	};
};
//>>>
//<<<Calendar change
function calendarChange(Month, Year) {
	$.post('/edit/ajax_calendar_change', { Month:Month, Year:Year }, function(data) {
		jsonData = jQuery.parseJSON(data);
		$('#calendarMesh').replaceWith(jsonData.calendar);
		val_Year_selected.text(jsonData.year);
		val_Month_selected.text(jsonData.month);
		Loading('hide', false, $('#calendarMesh'), $('#calendarMesh tr'));
	}, "text");
};
//>>>
//<<<Update day panel info
function update_day_panel_info(day, money, vizovov) {
	val_Day_selected.text(day);
	val_Day_selected_money.text(money);
	val_Day_selected_vizovov.text(vizovov);
	if (currentDay_Element.parent('td').find('.day_vizovov').text() != '') {
		currentDay_Element.parent('td').find('.day_vizovov').text(vizovov);
		currentDay_Element.parent('td').find('.day_money').text(money);
	} else {
		if (vizovov > 0) {
			$('<div class="day_vizovov">'+vizovov+'</div>').insertBefore(currentDay_Element);
			$('<div class="day_money">'+money+'</div>').insertAfter(currentDay_Element);
		};
	};
};
