//<<<Movinig calendar back and forth
function moving_back_and_forth_in_calendar() {
	panel_Patient_record_info.hide();
	panel_Patient_record.hide();
	Loading('show', false, $('#calendarMesh'), $('#calendarMesh tr'));
	calendarChange(selMonth, selYear);
	update_day_panel_info('', '', '');
	selDay = 0;
};
