//<<<Getting information about day
function getInformation_about_Day(day, month, year) {
	panel_Patient_record.find('.record_patient_wrapper').hide();
	$.post('/edit/ajax_pull_vizovs', { Day:day, Month:month, Year:year }, function(data) {
		if (data.Status === 'Error') {
			alert('Something went wrong\nError:'+data.Detail);
			panel_Patient_record.find('.record_patient_wrapper').show();
		} else {
			panel_Patient_search_results.hide();
			panel_Record_search.hide();
			panel_Patient_record.find('.record_patient_wrapper').remove();
			Patients.length = 0;
			var money = 0; var vizovov = 0;
			for (var patient in data) {
				money = money + data[patient].GreenMoney;
				vizovov = vizovov + 1;
				var pat = {};
				pat = {
					ID: data[patient].Name2+data[patient].Name1+data[patient].Name3,
					KeyName: data[patient].KeyName,
					Name1: data[patient].Name1,
					Name2: data[patient].Name2,
					Name3: data[patient].Name3,
					Firm: data[patient].Firm,
					GreenMoney: data[patient].GreenMoney,
					RedMoney: data[patient].RedMoney,
					Age: data[patient].Age,
					Street: data[patient].Street,
					House: data[patient].House,
					KC: data[patient].KC,
					Porch: data[patient].Porch,
					Passwd: data[patient].Passwd,
					Floor: data[patient].Floor,
					Apt: data[patient].Apt,
					Tel1: data[patient].Tel1,
					Tel2: data[patient].Tel2,
					Note: data[patient].Note,
					Decease: data[patient].Decease
				};
				Patients.push(pat);
				html_for_patient_record(data[patient].Name1, data[patient].Name2, data[patient].Name3, data[patient].Firm, data[patient].GreenMoney, data[patient].RedMoney);
			};
			if (vizovov === 0) {
				panel_Patient_record.hide();
			} else {
				panel_Patient_record.show();
			};
			selDay = day;
			Loading('hide', true, panel_Day, panel_Day_inside);
			panel_Patient_loading.hide();
			update_day_panel_info(day, money, vizovov);
		};
	}, "json");
};
