//<<<Live search on Names
function liveSearch(elem, txt, whatField) {
    elem.find('li').remove();
    arr = jQuery.grep(whatField, function(value) {
	search = new RegExp(txt, "gi");
	if (value.match(search)) { return true; };
	return false;
    });
    if (arr.length > 0) {
	$.each(arr, function(i, v) {
	    elem.append('<li>'+v+'</li>')
	});
	elem.show();
    };
};    
